Chicken Lollipop

Ingredients:

Chicken Lollipop ‚Äì 10-12 pieces
Oil for Deep Frying

For the Chicken Marinade:

Red Chilli powder - 1 tbsp
Ginger Paste ‚Äì 1 tbsp 
Garlic Paste ‚Äì 1 tbsp 
Pepper Powder ‚Äì 1 tsp
Salt to taste (please go easy on the salt here as Soy Sauce does contain salt )
Soya Sauce ‚Äì 1 tbsp
White Vinegar ‚Äì 1 tbsp
Cornstarch ‚Äì 3 tbsp

For the Batter:
2 cups All Purpose Flour
1/2 cup Cornflour or Rice Flour
Salt to taste
1 tsp pepper 
1 tsp Garlic Powder
1 tsp Onion Powder
Red food colour 3-5 drops 

Method:

Wash and Clean chicken pieces, pat dry. In a mixing bowl, add all the ingredients listed under "Chicken Marinade". Mix well and coat chicken evenly and marinate for 30 minutes to an hour. 
Now for the batter, take another mixing bowl and add all the ingredients listed under "Batter". Add water ensuring you have a thick batter ready that should coat the chicken lollipops well.
Heat oil in a deep frying wok/pan/kadai. Once the oil is hot, carefully add the chicken pieces in it, keeping the flame on low. Cook on low heat for 10 mins till the chicken is cooked, ensuring the pieces are well fried and flipped over at intervals. Now increase the heat and fry the chicken on high heat for 5 mins till the chicken gets crispy and cooked.
